import React from "react";
import classes from './ReviewOverview.module.css';


const ReviewOverview = (props) => {
    return (
        <div className={classes.ReviewOverview}>
            <div className={classes.Satisfaction}></div>
        </div>
    );
}
export default ReviewOverview;
